import React from 'react';

const About = () => {
    return (
        <section id="about" className="bg-light py-5">
            <div className="container">
                <h2 className="text-center mb-4">About Us</h2>
                <p>
                    ALX Inspired is dedicated to empowering the next generation of leaders in Africa.
                    We provide education, opportunities, and a supportive community to help individuals
                    achieve their goals and make a positive impact in their communities.
                </p>
            </div>
        </section>
    );
};

export default About;
